mapper.select:

select 

from jvd_kyosoba_torihiki_kakaku
where KAISAI_KIKAN_KAISHIBI = #{kaisaiKikanKaishibi,jdbcType=TIMESTAMP}
  and KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and SHUSAISHA_SHIJO_CODE = #{shusaishaShijoCode,jdbcType=CHAR}

mapper.delete:

delete from jvd_kyosoba_torihiki_kakaku
where KAISAI_KIKAN_KAISHIBI = #{kaisaiKikanKaishibi,jdbcType=TIMESTAMP}
  and KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and SHUSAISHA_SHIJO_CODE = #{shusaishaShijoCode,jdbcType=CHAR}
